import { Container, Navbar } from "react-bootstrap";
import image1 from './arms.png'
import Image from "react-bootstrap";



function Header() {
  return (
    <Container>
      <Image src={image1} thumbnail></Image>
      <h3 className="header">THE HOLY BIBLE</h3>
    </Container>

  )
};


export default Header;
